import React from "react";
import { Card, List } from "antd";

function MovieDetails(props) {
  console.log(props.show);
  let days = [
    "Sunday",
    "Monday",
    "Tuesday",
    "Wednesday",
    "Thursday",
    "Friday",
    "Saturday",
  ];
  let months = [
    "January",
    "February",
    "March",
    "April",
    "May",
    "June",
    "July",
    "August",
    "September",
    "October",
    "November",
    "December",
  ];
  try {
    console.log(props.show.release_date.replace('/-/g', '/'))

  } catch(error) {
      
  }
  return (
    <Card title="Details" className="details">
      {props.show && (
        <>
          <div>
            <ul>
              <li>
                <strong>Movie: </strong> {props.show.title}
              </li>
              <li>
                <strong>Country: </strong> {props.show.countries}
              </li>
              <li>
                <strong>Release Date: </strong> {props.show.release_date}
              </li>
            </ul>
          </div>
        </>
      )}
    </Card>
  );
}

export { MovieDetails };
